-- ----------------------------
-- Procedure structure for insertGoodsData
-- ----------------------------
DROP PROCEDURE IF EXISTS `insertGoodsData`;
delimiter ;;
CREATE PROCEDURE `insertGoodsData`()
BEGIN
	declare i int;
	declare price double;
	declare qty int;
  set i=1;
START TRANSACTION;
  while(i<=500) do
		set price = rand() * 10000 + 2000;
		set qty = rand() * 100 + 20;
		values(rand()*7 + 1 , concat("凑数", i), concat("凑数", i), "个", price, price + rand()*1000+200, qty + rand()*100 + 50 , qty);
    set i=i+1;
  end while;
commit;

END
;;
delimiter ;

